    "2015-02-04T18:50:35.053087",nt"name": "workforce-economic-development-2010-bd405",nt"isopen":
    true,nt"url": null,nt"notes": "BNIA-JFI tracks fourteen workforce and economic
    development indicators that measure the importance of and role of the City as both
    a major source of labor andnas a center of economic activity. These indicators are
    grouped into the followingncategories: labor force participation and employment;
    educational attainment;ncommercial investment activity; and businesses and successful
    small businesses.nInformation for the City of Baltimore is now available on an annual
    basis from the American Community Survey (ACS), but community-level information
    is aggregated over 5-years of data collection. In Vital Signs 10, indicators were
    calculatednusing the 5-year average from the 2006-2010 ACS. Business data is purchased
    from InfoUSA and is available at the address level, which can be aggregated to the
    CSA level for Vital Signs. It is still important to note that the firm level data
    from InfoUSA is best to be analyzed at the City level since due to methodology issues,nindividual
    level firm data can be problematic to analyze.",nt"license_title": "Other
